<!DOCTYPE html><html><head><style id="MJX-SVG-styles">
mjx-container[jax="SVG"] {
  direction: ltr;
}

mjx-container[jax="SVG"] > svg {
  overflow: visible;
}

mjx-container[jax="SVG"] > svg a {
  fill: blue;
  stroke: blue;
}

mjx-container[jax="SVG"][display="true"] {
  display: block;
  text-align: center;
  margin: 1em 0;
}

mjx-container[jax="SVG"][display="true"][width="full"] {
  display: flex;
}

mjx-container[jax="SVG"][justify="left"] {
  text-align: left;
}

mjx-container[jax="SVG"][justify="right"] {
  text-align: right;
}

g[data-mml-node="merror"] > g {
  fill: red;
  stroke: red;
}

g[data-mml-node="merror"] > rect[data-background] {
  fill: yellow;
  stroke: none;
}

g[data-mml-node="mtable"] > line[data-line] {
  stroke-width: 70px;
  fill: none;
}

g[data-mml-node="mtable"] > rect[data-frame] {
  stroke-width: 70px;
  fill: none;
}

g[data-mml-node="mtable"] > .mjx-dashed {
  stroke-dasharray: 140;
}

g[data-mml-node="mtable"] > .mjx-dotted {
  stroke-linecap: round;
  stroke-dasharray: 0,140;
}

g[data-mml-node="mtable"] > g > svg {
  overflow: visible;
}

[jax="SVG"] mjx-tool {
  display: inline-block;
  position: relative;
  width: 0;
  height: 0;
}

[jax="SVG"] mjx-tool > mjx-tip {
  position: absolute;
  top: 0;
  left: 0;
}

mjx-tool > mjx-tip {
  display: inline-block;
  padding: .2em;
  border: 1px solid #888;
  font-size: 70%;
  background-color: #F8F8F8;
  color: black;
  box-shadow: 2px 2px 5px #AAAAAA;
}

g[data-mml-node="maction"][data-toggle] {
  cursor: pointer;
}

mjx-status {
  display: block;
  position: fixed;
  left: 1em;
  bottom: 1em;
  min-width: 25%;
  padding: .2em .4em;
  border: 1px solid #888;
  font-size: 90%;
  background-color: #F8F8F8;
  color: black;
}

foreignObject[data-mjx-xml] {
  font-family: initial;
  line-height: normal;
  overflow: visible;
}

.MathJax path {
  stroke-width: 3;
}
</style></head><body><mjx-container class="MathJax" jax="SVG"><svg style="vertical-align: -0.489ex" xmlns="http://www.w3.org/2000/svg" width="10.992ex" height="2.109ex" role="img" focusable="false" viewBox="0 -716 4858.7 932" xmlns:xlink="http://www.w3.org/1999/xlink"><g stroke="currentColor" fill="currentColor" stroke-width="0" transform="scale(1,-1)"><g data-mml-node="math"><g data-mml-node="mi"><use xlink:href="#MJX-STX-I-1D44E"></use></g><g data-mml-node="mspace" transform="translate(555, 0)"></g><g data-mml-node="mo" transform="translate(1222, 0) translate(0 -20)"><use xlink:href="#MJX-STX-N-28"></use></g><g data-mml-node="mi" transform="translate(1579, 0)"><use xlink:href="#MJX-STX-N-6D"></use><use xlink:href="#MJX-STX-N-6F" transform="translate(852, 0)"></use><use xlink:href="#MJX-STX-N-64" transform="translate(1366, 0)"></use></g><g data-mml-node="mspace" transform="translate(3650.7, 0)"></g><g data-mml-node="mi" transform="translate(3983.7, 0)"><use xlink:href="#MJX-STX-I-1D44F"></use></g><g data-mml-node="mo" transform="translate(4501.7, 0) translate(0 -20)"><use xlink:href="#MJX-STX-N-29"></use></g></g></g></svg></mjx-container><mjx-container class="MathJax" jax="SVG" display="true" justify="left"><svg style="vertical-align: -0.489ex" xmlns="http://www.w3.org/2000/svg" width="11.746ex" height="2.109ex" role="img" focusable="false" viewBox="0 -716 5191.7 932" xmlns:xlink="http://www.w3.org/1999/xlink"><g stroke="currentColor" fill="currentColor" stroke-width="0" transform="scale(1,-1)"><g data-mml-node="math"><g data-mml-node="mi"><use xlink:href="#MJX-STX-I-1D44E"></use></g><g data-mml-node="mspace" transform="translate(555, 0)"></g><g data-mml-node="mo" transform="translate(1555, 0) translate(0 -20)"><use xlink:href="#MJX-STX-N-28"></use></g><g data-mml-node="mi" transform="translate(1912, 0)"><use xlink:href="#MJX-STX-N-6D"></use><use xlink:href="#MJX-STX-N-6F" transform="translate(852, 0)"></use><use xlink:href="#MJX-STX-N-64" transform="translate(1366
